import React from "react";

const About = () => {
    return (
        <div>
            <h1 className="about__block">Добро пожаловать на ресурс FilmPro</h1>
            <div>Здесь представлен сборник лучших фильмов в истории кинемотографа, а также информация о жанре, стране производства и рейтиинге на различных платформах</div>
        </div>

    )
}

export default About;
